import React from 'react';

export default function Content() {
  return ( 
  <div className = "show2">
     <form>
        <h1 className="login-text">Type Your Notes Here !!</h1>
        <label for="title">Title</label>
        <input type="text" id="title" name="lastname" placeholder="Your last name.."></input>
     </form>
  </div>);
}
